&lt;h2&gt;What Does Facebook Page Mean?&lt;/h2&gt;

&lt;p&gt;A Facebook page is a public profile created by businesses, organizations, celebrities and anyone seeking to promote themselves publicly through social media. Facebook pages work much like personal profile pages, except that they have &ldquo;fans&rdquo; instead of &ldquo;friends.&rdquo; These pages are publicly visible online and often post status updates, links, events, photos and videos to their fans&rsquo; news feeds and walls.&lt;/p&gt;

&lt;p&gt;Facebook pages provide a way for businesses and other organizations to interact with &ndash; rather than just advertise to &ndash; potential customers. They also provides a simple hub of information about the page&rsquo;s owner.&lt;/p&gt;

&lt;p&gt;Pages are&nbsp;&lt;strong&gt;places on Facebook where artists, public figures, businesses, brands, organizations and nonprofits can connect with their fans or customers&lt;/strong&gt;. When someone likes or follows a Page on Facebook, they can start seeing updates from that Page in their Feed. To see an example of a Page, see the screenshot below.&lt;/p&gt;
